  class Compiler {
    // é…ç½®é’©å­
    initHooks() {
      // é…ç½®é’©å­
      this.hooks = {
          entryOption: new SyncHook(),
          compile: new SyncHook(),
          afterCompile: new SyncHook(),
          afterPlugins: new SyncHook(),
          run: new SyncHook(),
          emit: new SyncHook(),
          done: new SyncHook()
      }
    }

    // æ³¨å†Œä¸€ä¸ªè°ƒç”¨ plugin çš„æ–¹æ³•
    hanldePlugins() {
      // å¤„ç†æ’ä»¶
      let { plugins } = this.config
      if (Array.isArray(plugins)) {

          plugins.forEach((plugin) => {
              plugin.apply(this) // æ¯ä¸ªæ’ä»¶é‡Œé¢éƒ½ä¼šæœ‰ä¸€ä¸ªapplyæ–¹æ³•æ¥è°ƒç”¨
          })
          this.hooks.afterPlugins.call(this)
      }
    }


    // ç»§ç»­ä¿®æ”¹å¯åŠ¨é¡¹ è¿è¡Œæ¨¡å—
    start(){
      this.hooks.run.call(this)
      this.hooks.compile.call(this)

      this.buildModules(path.resolve(this.root, this.entry),this.entry)

      this.hooks.afterCompile.call(this)

      this.writeFile()

      this.hooks.emit.call(this)
      this.hooks.done.call(this)
    }
  }


